    <div class=""container"">
    <h1 > Produtos</h1>
    <p >Cabelos crespos ficaram quase extintos com a onda dos fios chapados. Mas quem assume as madeixas no estilo
        afro, chama a atenção por onde passa. Por isso, não é preciso escondê-los. Para deixar os cabelos crespos ainda
        mais lindos,pode-se lançar mão de penteados e cores, além de ter alguns cuidados especiais com o cabelo
        afro.
    </p>
    <div>
        <h2>Cremes, Shampoos e Condicionadores</h2>
        <p>
            Hidratação – Os cabelos crespos devem ser hidratados semanalmente. Aposte nos produtos à base de silicone,
            colágeno e de elastina, proteínas, óleos e extratos vegetais, ceramidas e vitamina que repõem nutrientes e
            ajudam a unir as pontas duplas.

            Cabelo Afro requer hidratação e condicionamento profundo, principalmente quando o cabelo estiver exposto a
            relaxantes químicos, penteados puxados e aparelhos de calor, como enroladores e chapinhas. Um con");
                WriteLiteral(@"dicionador
            não
            é nada mais do que um creme aplicado ao cabelo para alisar os fios, amaciar o cabelo e restaurar a
            hidratação.
            Alguns óleos também podem ajudar. Concentre-se em hidratar tudo, apenas sempre excluindo o couro cabeludo.
        </p>
